REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4457,'','pt_BR','submit_term','Compromisso Geral:\r\n\r\nDeclaro que conheço e cumprirei os requisitos da Res. 196/96 e suas complementares. Comprometo-me a utilizar os materiais e dados coletados exclusivamente para os fins previstos no protocolo e publicar os resultados, sejam eles favoráveis ou não. Aceito as responsabilidades pela condução científica do projeto agora submetido. \r\n\r\nCompromisso de financiamento e Orçamento:\r\n\r\nDeclaro conhecer o fato de que: - não deve haver pagamento ao sujeito da pesquisa para sua participação, e que se admite apenas o ressarcimento de despesas necessárias ao seu acompanhante, por exemplo, despesas com passagens e alimentação. Nenhum exame ou procedimento realizado em função exclusivamente da pesquisa pode ser cobrado do paciente ou do agente pagador de sua assistência, devendo o patrocinador da pesquisa cobrir tais despesas. – o duplo pagamento pelos procedimentos não pode ocorrer especialmente envolvendo gasto público não autorizado (SUS). – o estabelecimento dos pagamentos de exames ou procedimento realizado em função exclusivamente da pesquisa, em caso de patrocinadores externos, devem ser de comum acordo entre o patrocinador e a Instituição. – Instituição deve ter o conhecimento da pesquisa e de suas repercussões orçamentárias. – O pagamento do pesquisador nunca pode ser de tal monta que o induza a alterar a relação risco/benefício para os sujeitos da pesquisa. – A remuneração do pesquisador deve constar como item específico de despesa no orçamento da pesquisa. – O sistema CEP/CONEP desencoraja o pagamento do pesquisador baseado exclusivamente no número de voluntários recrutados para a pesquisa.\r\n\r\nCompromisso de indenização:\r\n\r\nDeclaro conhecer o fato de que essa pesquisa deve prever meios para garantia da indenização dos sujeitos de pesquisa (cobertura material), em reparação a dano imediato ou tardio, causado pela pesquisa ao ser humano a ela submetida, ou pelo dano material ou moral decorrente da violação do sigilo de informações pessoais, sem prejuízo das ações penais, civil e administrativa. Bem como, que jamais poderá ser exigido do sujeito da pesquisa, sob qualquer argumento, renúncia ao direito à indenização por dano.\r\n\r\nCompromisso metodológico:\r\n\r\nDeclaro conhecer o fato de que não se justifica submeter seres humanos a riscos inutilmente e toda pesquisa envolvendo seres humanos envolve risco (Res. CNS 196/196-V). Que, se o projeto de pesquisa for inadequado do ponto de vista metodológico ele é inútil e eticamente inaceitável. Que o projeto de pesquisa deve também conter metodologia e lista de referência bibliográfica adequada, suficiente e atualizada.\r\n\r\nCompromisso de documento:\r\n\r\nDeclaro conhecer a obrigação da entrega de relatórios parciais da pesquisa ao CEP PUCPR.\r\n\r\nCompromisso de conteúdo:\r\n\r\nDeclaro que o conteúdo do protocolo de pesquisa aqui submetido é equivalente ao protocolo original e que estou obrigado (a) a informar por escrito e antecipadamente ao CEP PUCPR eventuais mudanças que venham a ser efetuadas no presente protocolo. Estou ciente de que devo manter todos os documentos originais do protocolo em meu poder até a entrega do relatório final.\r\n\r\nCompromisso de documentos originais:\r\n\r\nEstou ciente e concordo que a apresentação dos documentos originais poderá ser solicitada pelo CEP PUCPR a qualquer tempo, sendo minha obrigação apresentá-los prontamente quando solicitado.',1,0);
