REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4525,'','pt_BR','question_1','<B>1. Validade Social</B>\r\nO estudo pode contribuir para o aprimoramento científico e saúde? Qual o potencial valor da pesquisa para cada benefício? ',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4526,'','en_US','question_1','<B>1. Social value</B>\r\nCan the study lead to improvements in health and well-being? \r\nWhat is the potential value of the research for each of the \r\nprospective beneficiaries?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4527,'','es','question_1','<B>1. Valor social</B>\r\n¿Puede el estudio mejorar la salud y el bienestar? ¿Cuál es el valor potencial de la investigación para cada uno de los beneficiarios prospecto?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4528,'','fr','question_1','1.	Valeur sociale Est-ce que l´étude peut améliorer la santé et le bien-être? Quelle est la valeur potentielle de cette recherche pour chacun des bénéficiaires potentiels?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4529,'','pt_BR','question_2','<B>2.Viabilidade Científica</B>\r\n é a investigação com metodologicamente válida e cientificamente correta. Será que o estudo irá gerar dados válidos e confiáveis utilizados de forma útil? Será que o desenho do estudo a se realizar contempla os objetivos científicos, garantindo que as intervenções preservam a integridade do participante? O estudo é viável?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4530,'','en_US','question_2','<B>2. Scientific validity</B>\r\nIs the investigation methodologically valid and \r\nscientifically (and statistically) sound? Will the study \r\ngenerate valid and reliable data that can be generalizable \r\nand useful? Does the study design realize the scientific \r\nobjectives while guaranteeing participants the health-care \r\ninterventions to which they are entitled? Is the study \r\nfeasible?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4531,'','es','question_2','<B>2. Validez científica</B>\r\n¿Es la investigación metodológicamente válida y científicamente (y estadísticamente) rigurosa? ¿Generará el estudio datos válidos y confiables que pueden ser generalizables y útiles? ¿Realiza el diseño del estudio los objetivos científicos al mismo tiempo que garantiza a los participantes las intervenciones en salud a las cuales tienen derecho? ¿Es este un estudio factible?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4532,'','fr','question_2','2. Validité scientifique: Est-ce que l´enquête et son point de vue méthodologique est valable (statistiquement) et scientifiquement? L´étude fournira des données valables et fiables qui peuvent être généralisés et utiles? Est-ce que la conception de l´étude à réaliser les objectifs scientifiques tout en garantissant aux participants les interventions de soins de santé auxquels ils ont droit? L´étude est-elle réalisable?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4533,'','pt_BR','question_3','<B>3. Critérios de Inclusão e Exclusão da amostra</B> É a população da pesquisa selecionado para minimizar os riscos para os participantes? São participantes da pesquisa individuais selecionados para maximizar os benefícios potenciais? São os potenciais riscos e benefícios do estudo distribuídos de forma justa? O estudo não pode ser realizado de outra forma?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4534,'','en_US','question_3','<B>3. Fair participant selection</B> What are the criteria to include and exclude participants? Is selection of participants based on scientific criteria? Is the research population selected to minimize risks to participants? Are individual research participants selected to maximize potential benefits? If participants are vulnerable, are there any safeguards to protect them? Are the risks and potential benefits of the study fairly distributed?\r\n',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4535,'','es','question_3','<B>3. Selección justa de participantes</B>\r\n¿Cuales son los criterios de inclusion y exclusion de participantes? ¿Se basa la selección de participantes en criterios científicos? ¿Se selecciona la población de la investigación para minimizer los riesgos de los participantes? ¿Se selecciona a los participantes individuales de la investigación para maximar los posibles beneficios? Si hay participantes vulnerables, ¿existen salvaguardas para protegerlos de daños? ¿Se distribuyen equitativamente los riesgos y posibles beneficios del estudio?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4536,'','fr','question_3','3. Sélection des participants équitable: Quels sont les critères pour inclure ou exclure des participants? Est-ce que la sélection des participants est fondée sur des critères scientifiques? Est-ce que la population étudiée est sélectionnée pour minimiser les risques pour les participants? Est-ce que les participants individuels de cette recherche ont été sélectionnés pour maximiser les avantages potentiels? Si les participants sont vulnérables, y a-t-il des garanties pour les protéger? Est-ce que les risques et les avantages potentiels de l´étude sont répartis équitablement?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4537,'','pt_BR','question_4','<B>4. Favorable risk-benefit ratio</B> Can the risks for \r\nparticipants be minimized? Can potential benefits for \r\nindividuals and society be improved? Do the potential benefits \r\nfor society and individuals outweigh the risks?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4538,'','en_US','question_4','<B>4. Favorable risk-benefit ratio</B> Can the risks for \r\nparticipants be minimized? Can potential benefits for \r\nindividuals and society be improved? Do the potential benefits \r\nfor society and individuals outweigh the risks?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4539,'','es','question_4','<B>4. Relación favorable de riesgo-beneficio</B> ¿Pueden minimizarse los riesgos para los participantes? ¿Pueden mejorarse los posibles beneficios para los individuos y para la sociedad? Los posibles beneficios para la sociedad e individuos, ¿sobrepasan los riesgos?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4540,'','fr','question_4','4. Rapport bénéfice/ risque favorable: Peuvent les risques être minimisés pour les participants? Peuvent les avantages potentiels des individus et la société être améliorée? Est-ce que les avantages potentiels pour la société et les individus dépassent les risques?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4541,'','pt_BR','question_5','<B>5. Informed consent</B> Is the information provided to \r\npotential participants accurate, clear, relevant and \r\ncomplete? Are the recruitment procedures, consent process \r\nand incentives appropriate for their culture and context? Is \r\nthere an appropriate plan for obtaining permission for those \r\nthat can’t consent for themselves? Are the participants \r\nbeing made aware of their right to refuse to participate and \r\nare they actually free to refuse?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4542,'','en_US','question_5','<B>5. Informed consent</B> Is the information provided to \r\npotential participants accurate, clear, relevant and \r\ncomplete? Are the recruitment procedures, consent process \r\nand incentives appropriate for their culture and context? Is \r\nthere an appropriate plan for obtaining permission for those \r\nthat can’t consent for themselves? Are the participants \r\nbeing made aware of their right to refuse to participate and \r\nare they actually free to refuse?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4543,'','es','question_5','<B>4. Consentimiento informado</B> La información que se prove a los posibles participantes, ¿es exacta, clara, relevante y complete? Los procedimientos de reclutamiento, consentimiento e incentivos, ¿son apropiados para su cultura y context? ¿Hay un plan apropriado para obtener el permiso de aquellos que no pueden copnsentir por si mismos? ¿Se les hace saber a los participantes sobre su derecho de rehusarse a participar y son de hecho libres de rehusarse?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4544,'','fr','question_5','5.	Le consentement éclairé est l´information précise, claire, pertinente et complète, fournie aux participants potentiels? Est- ce que les procédures de recrutement, le processus de consentement et d´incitations, appropriées pour leur culture et leur contexte? Y a-t-il un plan approprié pour obtenir la permission pour ceux qui ne peuvent pas donner leur consentement? Est-ce que les participants sont informés de leur droit de refuser de participer, et sont-ils réellement libre de refuser?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4545,'','pt_BR','question_6','<B>6. Respect for participants</B> How will the health and \r\nwell-being of participants be monitored to minimize harms? \r\nHow will their privacy be protected? Can participants \r\nwithdraw from the study without penalty? What are the plans \r\nof care after the study is completed? Will participants be \r\ngiven any new information (including the results of the \r\nstudy)?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4546,'','en_US','question_6','<B>6. Respect for participants</B> How will the health and well-being of participants be monitored to minimize harms? How will their privacy be protected? Can participants withdraw from the study without penalty? What are the plans of care after the study is completed? Will participants be given any new information (including the results of the study)?\r\n',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4547,'','es','question_6','<B>6. Respeto para con los participantes</B> ¿Cómo se monitoreará la salud y bienestar de los participantes para minimizer los daños? ¿Cómo se protegerá su privacidad? ¿Pueden los participantes retirarse del estudio sin ninguna sanción? ¿Cuáles son los planes de atención después que termine el estudio? ¿Se le dará alguna nueva información a los participantes (incluyendo los resultados del estudio)?',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (4548,'','fr','question_6','6.	Respect pour les participants: Comment est-ce que la santé et le bien-être des participants seront contrôlés afin de minimiser les méfaits? Comment leur vie privée sera protégée? Est-ce que les participants peuvent se retirer de l´étude sans pénalité? Quels sont les plans de soins après l´étude soit terminée? Les participants recevront il toute nouvelle information (y compris les résultats de l´étude)?',1,0);
