REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (6109,'','pt_BR','dictamen_APR_2','O registro de um ensaio clínico consiste em responsabilidade ética e científica. Todo ensaio clínico deve ser registrado em uma plataforma para este fim, capaz de dar publicidade às suas características, antes da inclusão do primeiro sujeito de pesquisa. Se você necessitar dec auxílio para registrar seu projeto, não deixe de fazer contato conosco.\r\nNos convidamos os investigadores a planejar a publicação e a utilização dos resultados de suas pesquisas. Também encorajamos a publicação em periódicos indexados de de acesso livre.\r\nPor favor informe ao Comitê sobre esta decisão, bem como sobre qualquer modificação que venha a ser realizada neste projeto.',1,0);
REPLACE INTO `_messages` (`id_msg`, `msg_pag`, `msg_language`, `msg_field`, `msg_content`, `msg_ativo`, `msg_update`) VALUES (6110,'','en_US','dictamen_APR_2','------------------------------\r\n\r\nThe registration of all clinical trials is a scientific and ethical responsibility. Every \r\nclinical trial must be registered in a publicly accessible database before recruitment of the \r\nfirst participant. If you have trials to register and need assistance, don’t hesitate to \r\ncontact us for advice. \r\n\r\nWe invite researchers to plan the publication and use of research results. We encourage the \r\npublication in indexed open access journals. \r\n\r\nPlease inform the local review committees about this decision. You must inform PAHOERC if there \r\nare any significant changes to the implementation of this proposal.\r\n',1,0);
