REPLACE INTO `cep_submit_documentos_obrigatorio` (`id_sdo`, `sdo_codigo`, `sdo_descricao`, `sdo_content`, `sdo_info`, `sdo_ativo`, `sdo_obrigatorio`, `sdo_tipo`, `sdo_upload`, `sdo_modelo`, `sdo_ordem`) VALUES (1,'00004','Parecer','Clique aqui para visualizar ou imprimir o parecer de seu protocolo.','S? s?o disponibilizados via internet os pareceres considerados com pend?ncias. Se o seu parecer tiver outro tipo de resultado de aprecia??o, voc? dever? busc?-lo na secretaria do CEP PUCPR nos hor?rios e atendimento externo.',1,0,'PAR',1,'',20);
REPLACE INTO `cep_submit_documentos_obrigatorio` (`id_sdo`, `sdo_codigo`, `sdo_descricao`, `sdo_content`, `sdo_info`, `sdo_ativo`, `sdo_obrigatorio`, `sdo_tipo`, `sdo_upload`, `sdo_modelo`, `sdo_ordem`) VALUES (2,'00007','Compromissso do Pesquisador e Delega??o de Poderes','<font color=\"#366FF\">Declara??o de compromisso do pesquisador respons?vel e termo de delega??o de poderes para o acompanhamento do projeto por terceiros.</font>\r\n<p><font color=\"#366FF\">ESTE DOCUMENTO ? NECESS?RIO PARA QUE OUTRAS PESSOAS, AL?M DO PESQUISADOR RESPONS?VEL, POSSAM ACOMPANHAR O ANDAMENTO DO PROCESSO NO CEP, INCLUINDO A RETIRADA DE PARECERES. SEU ENVIO ? OBRIGAT?RIO, MESMO QUE O PESQUISADOR N?O DESEJE DELEGAR O DIREITO DE ACOMPANHAR O PROCESSO NO CEP.</font></p>','Esta declara??o ? obrigat?ria e somente as pessoas cujos nomes constarem no documento, poder?o acompanhar o andamento do processo no CEP PUCPR, incluindo a retirada de pareceres na Secretaria do Comit?.',1,0,'JPG',1,'http://www.pucpr.br/pesquisa_cientifica/cep/documentos/SPAT.doc',5);
REPLACE INTO `cep_submit_documentos_obrigatorio` (`id_sdo`, `sdo_codigo`, `sdo_descricao`, `sdo_content`, `sdo_info`, `sdo_ativo`, `sdo_obrigatorio`, `sdo_tipo`, `sdo_upload`, `sdo_modelo`, `sdo_ordem`) VALUES (3,'00002','Termo de Compromisso de Utiliza??o de Dados','<font color=\"#366FF\">A apresenta??o do TCUD ? <b>obrigat?ria</b> para todos os projetos nos quais ser? realizada qualquer tipo de pesquisa em um banco de dados. Relacione no documento todos os pesquisadores que poder?o acessar os arquivos.</font> \r\n<p><font color=\"#366FF\"> A FALTA INJUSTIFICADA DA APRESENTA??O DESTE TERMO OU DO TERMO DE CONSENTIMENTO LIVRE E ESCLARECIDO, CONFORME O CASO, IMPLICAR? NA REJEI??O DA SUBMISS?O DE SEU PROTOCOLO\".</font></p>','Anexe aqui o modelo de seu Termo de Compromisso de Utiliza??o de Dados. Voc? poder? usar o modelo sugerido que pode ser obtido clicando na op??o \"baixe um modelo deste documento\". Tenha claro que ? obrigat?ria a apresenta??o deste documento em protocolos nos quais ser?o pesquisados documentos que constam de banco de dados, como arquivos de prontu?rios m?dicos e de outros documentos que contenham dados de pessoas. Relacione no documento todos os pesquisadores que poder?o acessar os arquivos.',1,-2,'TCUD',1,'http://www.pucpr.br/pesquisa_cientifica/cep/documentos/compromisso.doc',2);
REPLACE INTO `cep_submit_documentos_obrigatorio` (`id_sdo`, `sdo_codigo`, `sdo_descricao`, `sdo_content`, `sdo_info`, `sdo_ativo`, `sdo_obrigatorio`, `sdo_tipo`, `sdo_upload`, `sdo_modelo`, `sdo_ordem`) VALUES (4,'00006','Outros documentos','<font color=\"#366FF\">Carregue aqui outros documentos digitalizados que julgar importante como parte do protocolo do estudo.</font>','Aqui voc? poder? anexar ao seu protocolo qualquer outro documento que n?o se enquadre como TCLE ou Termo de Compromisso de Uso de Dados, como por exemplo uma declara??o de responsabilidade pelo financiamento do or?amento ou uma autoriza??o especial para alguma atividade do projeto.',1,-1,'',1,'',12);
REPLACE INTO `cep_submit_documentos_obrigatorio` (`id_sdo`, `sdo_codigo`, `sdo_descricao`, `sdo_content`, `sdo_info`, `sdo_ativo`, `sdo_obrigatorio`, `sdo_tipo`, `sdo_upload`, `sdo_modelo`, `sdo_ordem`) VALUES (5,'00005','Formul?rio ou question?rio','<font color=\"#366FF\">Se houver, anexe o formul?rio de pesquisa ou o question?rio que ser? aplicado aos sujeitos do estudo. Quando se aplicar, a apresenta??o do conte?do do instrumento de pesquisa ? <b>obrigat?ria</b></font>.','Se voc? for submeter um question?rio ou outro tipo de instrumento de pesquisa aos sujeitos, ? <b>obrigat?ria</b> a apresenta??o do seu conte?do ao CEP. Neste espa?o voc? poder? anex?-lo ao seu protocolo.',1,-1,'FOR',1,'',10);
REPLACE INTO `cep_submit_documentos_obrigatorio` (`id_sdo`, `sdo_codigo`, `sdo_descricao`, `sdo_content`, `sdo_info`, `sdo_ativo`, `sdo_obrigatorio`, `sdo_tipo`, `sdo_upload`, `sdo_modelo`, `sdo_ordem`) VALUES (7,'00001','Termo de Consentimento Livre e Esclarecido','<font color=\"#366FF\">A apresenta??o do TCLE ? <b>obrigat?ria</b> para todos os projetos nos quais ser? realizada qualquer tipo de abordagem direta a seres humanos, mesmo que seja somente uma entrevista com sujeitos.</font> \r\n<p> <font color=\"#366FF\">A FALTA INJUSTIFICADA DA APRESENTA??O DESTE TERMO OU DO TERMO DE COMPROMISSO DE UTILIZA??O DE DADOS, CONFORME O CASO, IMPLICAR? NA REJEI??O DA SUBMISS?O DE SEU PROTOCOLO\".</font></p>','Envie o modelo do TCLE de seu projeto. A apresenta??o deste documento ? obrigat?ria para todos os projetos nos quais ser? realizada qualquer tipo de abordagem a seres humanos. Clicando em \"baixe um modelo deste documento\" voc? poder? acessar o modelo sugerido de TCLE . N?o esque?a de adaptar o modelo para as peculiaridades de seu projeto.',1,-2,'TCLE',1,'http://www.pucpr.br/arquivosUpload/1237436911258119968.doc',2);
